Our WSL PURE grantee, and #weareoneocean coalition member @wildcoastcostasalvaje, is helping to conserve coastal and marine ecosystems in California and Mexico. Part of this effort is providing hands-on conservation for critical sea turtle nesting habitat in and around Barra de La Cruz in Oaxaca, Mexico. Join us today to support this effort by visiting weareoneocean.org to sign and share the #weareoneocean petition.
--
We’re calling on world leaders to adopt a target at the 2021 United Nations Convention on Biological Diversity to protect and conserve at least 30 percent of the global ocean, including international waters, by 2030. We urge world leaders to be driven by science, and led by an inclusive process that embraces all stakeholder communities and considers the ocean’s value to the peoples of every nation.

